import React from "react";
import simple from './assets/simple.json'

export const Home = () => {
  return (
    <>
      <div>
        <h3>Latest & Trending</h3>
        <div>
          {simple &&
            simple.map((movie,index) => (
              <div className="card" key={index}>
                <h4>{movie.title}</h4>
              </div>
            ))}
        </div>
      </div>
    </>
  );
};
